<p><strong>ജൂനോ</strong>
</p>

<hr />
<p>
 വ്യാഴത്തിന്റെ ഭ്രമണപഥത്തിൽ വിജയകരമായി പ്രവേശിച്ച നാസയുടെ ബഹിരാകാശ പേടകം?
</p>

<p>❖ ജൂനോ
</p>

<p>
 സൗരോർജ്ജം ഉപയോഗിച്ച് ഏറ്റവും കൂടുതൽ ദൂരം  ഗ്രഹാന്തരയാത്ര നടത്തി റെക്കോർഡ് സൃഷ്ടിച്ച നാസയുടെ ബഹിരാകാശ പേടകം?
</p>

<p>❖ ജൂനോ
</p>
